import breeds from "../../data/pet-breeds.json";
import Util from "../xo/Util";
import ImageResizer from "../modules/ImageResizer";

const breedAutocomplete = (options, e) => {
  let rp = Util.closestElement("xo-repeat", e.target);
  let type = null;
  if (rp) {
    let index = Util.closestElement("xo-group", e.target).parentNode.parentNode
      .index;
    type = rp.items[index].type;
  }
  let bd = breedData;

  if (type) bd = breeds[type.toLowerCase()];

  let search = options.search.toLowerCase();
  return bd
    .filter((i) => {
      return i.name.toLowerCase().indexOf(search) >= 0;
    })
    .map((x) => {
      return {
        text: x.name,
      };
    });
};

